import React from 'react';
import Todo from './Todo';

const todos =[
    {
        "description":"Einkauf",
        "done":true
    },
    {
        "description":"Programmieren",
        "done":false
    },
    {
        "description":"Sport",
        "done":false
    }
]


const TodoList = () => {
    return (
        <div>
            <h1>My Todos</h1>
            <hr></hr>
            <Todo description={todos[0].description} done={todos[1]}></Todo>
            <Todo></Todo>
            <Todo></Todo>
            <Todo></Todo>
        </div>
  )
}

export default TodoList;
